        let g = 133
        let b = 209

        while (floorBoardYPos < p.windowHeight * .75) {
            p.fill(r, g, b);
            p.rect(0, floorBoardYPos, p.windowWidth * .75/45, (p.windowHeight * .75) / 40);
            floorBoardYPos += (p.windowHeight * .75) / 40
            if (r == 40) {
                r = 225;
                g = 232;
                b = 231
            } else if (r == 225) {
                r = 40;
                g = 133;
                b = 209
            }
        }
